import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { CreatePayrollComponent } from '../create-payroll/create-payroll.component';
import { ViewPayrollComponent } from '../view-payroll/view-payroll.component';
import { PayrollComponent } from '../payroll.component';
import { ViewPayrollDetailComponent } from '../view-payroll-detail/view-payroll-detail.component';

const payrollRoute: Routes = [{
  path: '',
  component: PayrollComponent,
  data: {
      defaultSort: 'id,asc'
  },
  canActivate: [UserRouteAccessService]
},
{
  path: 'create',
  component: CreatePayrollComponent,
  data: {
      defaultSort: 'id.asc'
  },
  canActivate: [UserRouteAccessService]
}
]

@NgModule({
  imports: [RouterModule.forChild(payrollRoute)],
  exports: [RouterModule]
})

export class PayrollRecordRoutingModule {}
